From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
M.A. Coletta (Mike)
Sent: Friday, November 28, 2008 12:44 PM
To: EVP-ITC@yahoogroups.com
Subject: [EVP-ITC] New TV rules will open up your older 12-470&#39;s & more



Greetings fellow researchers, 

If you&#39;re lucky enough to own a &#39;hacked&#39; older Radio Shack 12-470, you may
be in for a surprise after the TV signals go from analog to digital. 
The current TV band audio is currently being broadcast in analog format. The
12-470 has a TV audio band segment, which now when hacked sweeps the TV
audio in your area. 
After the stations stop broadcasting their analog signals, 12-470 owners may
have an additional opportunity to be able to sweep the following
frequencies, with no interference from those high powered signals. 

Channel - Audio Frequency 
2 - 59.75 MHz 
3 - 65.75 MHz 
4 - 71.75 MHz 
5 - 81.75 MHz 
6 - 87.75 MHz 
7 - 179.75 MHz 
8 - 185.75 MHz 
9 - 191.75 MHz 
10 - 197.75 MHz 
11 - 203.75 MHz 
12 - 209.75 MHz 
13 - 215.75 MHz 

Who knows what type of signals we may be able to hear when these frequencies
are open and clear. This could also provide an opportunity to produce some
additional experimental devices for that region of the band. Some good ghost
box type experiments! 

And as an added bonus... for those interested in ITC video, just think of
the opportunities that will be available for you when all those TV channels
have no signal. That too opens up a wealth of possibilities. Lots of
available white noise and empty video patterns for ITC research on more
unused channels, without having the worry of adjacent channel interference. 

Ahh... paranormal research life will be even better! 

- Mike (UFO Geek) 
http://www.ufogeek. &lt;http://www.ufogeek.com&gt; com




